import { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function AdminLogin() {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [error, setError] = useState("");
    const [isLoggedIn, setIsLoggedIn] = useState(false);
    const navigate = useNavigate();

    const handleLogin = (e) => {
        e.preventDefault();

        const ADMIN_EMAIL = "elhara@gmail.com";
        const ADMIN_PASSWORD = "008800";

        if (email === ADMIN_EMAIL && password === ADMIN_PASSWORD) {
            // โ ุงุญูุธ ุงูุญุงูุฉ ุฃููุงู
            localStorage.setItem("isAdmin", "true");

            // โ ุซู ุฃุนุฏ ุงูุชูุฌูู ุจุนุฏ ุชุฃููุฏ ุงูุญูุธ
            setTimeout(() => {
                navigate("/admin/dashboard");
            }, 100);
        } else {
            setError("ุจูุงูุงุช ุงูุฏุฎูู ุบูุฑ ุตุญูุญุฉ");
        }
    };


    // โ ุฅุฐุง ุชู ุชุณุฌูู ุงูุฏุฎูู ุจูุฌุงุญุ ูุนุฑุถ ุฎูุงุฑุงุช ุงูุฅุฏุงุฑุฉ
    if (isLoggedIn) {
        return (
            <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 text-center p-6">
                <div className="bg-white p-8 rounded-xl shadow-lg w-full max-w-md space-y-6">
                    <h2 className="text-2xl font-bold text-blue-700">
                        โ ุชู ุชุณุฌูู ุงูุฏุฎูู ุจูุฌุงุญ
                    </h2>
                    <p className="text-gray-600">
                        ุงุฎุชุฑ ุงูุตูุญุฉ ุงูุชู ุชุฑุบุจ ุจุงูุงูุชูุงู ุฅูููุง ๐
                    </p>

                    <div className="space-y-4">
                        <button
                            onClick={() => navigate("/admin/dashboard")}
                            className="w-full bg-green-600 text-white py-2 rounded-lg hover:bg-green-700 transition"
                        >
                            โ ุตูุญุฉ ุฅุถุงูุฉ ุงููุชุจ
                        </button>

                        <button
                            onClick={() => navigate("/admin/manage-books")}
                            className="w-full bg-blue-600 text-white py-2 rounded-lg hover:bg-blue-700 transition"
                        >
                            โ๏ธ ุตูุญุฉ ุฅุฏุงุฑุฉ ุงููุชุจ
                        </button>
                    </div>

                    <button
                        onClick={() => {
                            localStorage.removeItem("isAdmin");
                            setIsLoggedIn(false);
                        }}
                        className="text-sm text-gray-500 underline hover:text-red-500 mt-4"
                    >
                        ุชุณุฌูู ุฎุฑูุฌ
                    </button>
                </div>
            </div>
        );
    }

    // โ ูุงุฌูุฉ ุชุณุฌูู ุงูุฏุฎูู ุงูุงูุชุฑุงุถูุฉ
    return (
        <div className="min-h-screen flex items-center justify-center bg-gray-100">
            <form
                onSubmit={handleLogin}
                className="bg-white p-8 rounded-xl shadow-lg w-full max-w-sm space-y-5"
            >
                <h2 className="text-2xl font-bold text-center text-blue-700">
                    ุชุณุฌูู ุฏุฎูู ุงูุฅุฏุงุฑุฉ
                </h2>

                {error && (
                    <p className="text-red-600 text-sm text-center">{error}</p>
                )}

                <div>
                    <label className="block mb-1 text-gray-600">
                        ุงูุจุฑูุฏ ุงูุฅููุชุฑููู
                    </label>
                    <input
                        type="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        className="w-full border rounded-lg px-3 py-2 focus:ring-2 focus:ring-blue-500"
                        required
                    />
                </div>

                <div>
                    <label className="block mb-1 text-gray-600">
                        ูููุฉ ุงููุฑูุฑ
                    </label>
                    <input
                        type="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        className="w-full border rounded-lg px-3 py-2 focus:ring-2 focus:ring-blue-500"
                        required
                    />
                </div>

                <button
                    type="submit"
                    className="w-full bg-blue-600 text-white py-2 rounded-lg hover:bg-blue-700 transition"
                >
                    ุฏุฎูู
                </button>
            </form>
        </div>
    );
}
